import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchDataAction } from "../../Redux/Actions";

export const TodaysMatchResults = () => {
  const data = useSelector(
    (state) =>
      state.fetchDataReducer &&
      state.fetchDataReducer[
        "https://api.jsonbin.io/b/5edaad9e2f5fd957fda48c88"
      ]
  );

  const dispatch = useDispatch();

  useEffect(() => {
    !data &&
      dispatch(
        fetchDataAction({
          url: "https://api.jsonbin.io/b/5edaad9e2f5fd957fda48c88",
        })
      );
  }, [dispatch, data]);

  console.log(data);
  return <div>yoyoyo</div>;
};
